import React, { Component } from 'react';
import { Linkedin } from 'react-feather';
import { Instagram } from 'react-feather';
import { GitHub } from 'react-feather';
class Social extends Component {
    render() {
        return (
            <div>
            <a className="socialLink" href="https://Linkedin.com/in/will-hofkamp-528603186" rel="noopener noreferrer"><Linkedin /></a>
            <a className="socialLink" href="https://github.com/WillHofkamp" rel="noopener noreferrer"><GitHub /></a>
            <a className="socialLink" href="https://Instagram.com/WillHofkamp" rel="noopener noreferrer"><Instagram /></a>
            </div>
            )
        }
    }

export default Social
